</Routes>

function App() {
  return (
    <div className="App">
      <Navbar />
      <Body />
      <Body2 />
      <Fitness />
      <Trainers />
      <Achievements />
      <Pricing />
      <About />
      <ClassSchedule classes={classes} />

    </div>
  );
}

export default App;
